INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (122601, 1.5, 1, 160, 0.029, 110, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 0, 1, 1, 101, 1, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (122401, 2.5, 0, 120, 0.014, 105, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 1, 2, 3, 102, 2, 111);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (122501, 2.5, 0, 350, 0.017, 110, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 1, 0, 3, 2, 103, 3, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (107501, 1.5, 0, 130, 0.016, 110, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 1, 4, 3, 104, 4, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (107601, 2.5, 1, 160, 0.014, 110, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 0, 5, 1, 105, 5, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (107801, 3.5, 0, 255, 0.029, 120, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 1, 0, 6, 2, 106, 6, 103);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (110601, 3.5, 1, 160, 0.013, 120, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 0, 7, 1, 107, 7, 103);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (110401, 2.5, 0, 350, 0.014, 110, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 1, 0, 8, 2, 108, 8, 103);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (110501, 1.5, 0, 130, 0.012, 105, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 1, 9, 3, 109, 9, 100);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (115701, 2.5, 1, 200, 0.014, 105, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 0, 10, 1, 110, 10, 103);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (113601, 2.5, 0, 350, 0.071, 105, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 1, 0, 11, 2, 111, 11, 103);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (107901, 1.5, 0, 130, 0.014, 120, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 1, 12, 3, 112, 12, 103);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (108001, 1.5, 1, 200, 0.022, 110, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 0, 13, 2, 113, 13, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (110301, 2.5, 1, 160, 0.031, 110, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 0, 14, 1, 114, 14, 108);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (107701, 0.5, 0, 130, 0.036, 110, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 1, 15, 1, 115, 15, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (113101, 3.5, 0, 350, 0.048, 110, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 1, 0, 16, 2, 116, 16, 95);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (113301, 1.5, 0, 130, 0.043, 105, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 1, 17, 3, 117, 17, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (113201, 1.5, 0, 130, 0.018, 105, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 1, 18, 2, 118, 18, 95);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (117001, 2.5, 1, 160, 0.021, 110, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 0, 19, 2, 119, 19, 108);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (113501, 2.5, 0, 255, 0.036, 110, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 1, 0, 20, 1, 120, 20, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (113401, 2.5, 0, 350, 0.02, 105, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 1, 0, 21, 3, 121, 21, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (110101, 2.5, 0, 130, 0.018, 110, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 1, 22, 1, 122, 22, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (110001, 3.5, 1, 160, 0.03, 105, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 0, 23, 3, 123, 23, 111);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (117201, 1.5, 0, 130, 0.027, 110, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 1, 24, 1, 124, 24, 103);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (117301, 3.5, 1, 160, 0.02, 105, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 0, 25, 2, 125, 25, 108);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (117401, 2.5, 0, 350, 0.04, 110, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 1, 0, 26, 3, 126, 26, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (117101, 3.5, 0, 350, 0.009, 110, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 1, 0, 27, 1, 127, 27, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (122901, 3.5, 0, 255, 0.022, 120, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 1, 0, 28, 1, 128, 28, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (122801, 2.5, 0, 130, 0.028, 110, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 1, 29, 3, 129, 29, 105);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (122701, 3.5, 1, 130, 0.023, 105, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 0, 30, 2, 130, 30, 108);
